import { useState } from 'react';
import Child from './Child';

function Game() {
  console.log('excute Game');
  let name = 'dell';
  const [nameNew, setNameNew] = useState('dellNew');
  return (
    <>
      <div
        onClick={() => {
          name = 'lee';
          setNameNew('leeNew');
        }}>
        {name}
        <br />
        {nameNew}
      </div>
    </>
  );
}

export default Game;
